function onMPHSlide(e){document.getElementById("MPHLabel").innerHTML=e}function onKPHSlide(e){document.getElementById("KPHLabel").innerHTML=e}function onRPMSlide(e){document.getElementById("RPMLabel").innerHTML=e}function calculateTireDiameter(){var e=parseInt(document.getElementById("tireWidth").value),t=parseInt(document.getElementById("aspectRatio").value),n=parseInt(document.getElementById("wheelDiameter").value);if(""!=e.value&&""!=t.value&&""!=n.value){var l=2*(t/100*(e/25.4))+n;document.getElementById("tireDiameter").value=l.toFixed(2)}}